def generate_role_name(role_name):
    # 初始化变量
    global RL4EMBEDDED_ARCHETYPE_INIT_NAME,METAHUMAN_CONTROLLER_AND_NODENAMES,METAHUMAN_MATH_NODE_NAME_LAYER
    
    # 计算节点ID计算次数
    math_node_number_times = 0
    
    math_node_id = 0
    
    # 重置字典
    METAHUMAN_CONTROLLER_AND_NODENAMES = {'guiControlNames':[],'math_node_name':[],'rl4Embedded_name':[]}
    METAHUMAN_MATH_NODE_NAME_LAYER = {}



    # 把guiControlNames列表的值重新命名赋予到新的字典列表中
    for i in guiControlNames:
        
        # 判断角色名字是否为空
        if role_name == '':
            guiControlNames_rename = i
        else:
            guiControlNames_rename = role_name + ':' + i
        
        METAHUMAN_CONTROLLER_AND_NODENAMES['guiControlNames'].append(guiControlNames_rename)

    # 遍历blendShapeInput_modifier_node_name字典
    for Index, BS_CTRL_Name in enumerate(blendShapeInput_modifier_node_name):
        
        # 根据控制点名字创建新的字典列表
        METAHUMAN_MATH_NODE_NAME_LAYER[METAHUMAN_CONTROLLER_AND_NODENAMES['guiControlNames'][Index]] = []


        # 遍历blendShapeInput_modifier_node_name字典
        for content_index,blendShape_content in enumerate(blendShapeInput_modifier_node_name[BS_CTRL_Name]):
            math_node_number_times += 1


            
            if math_node_number_times == 2:
                math_node_number_times = 0
            else:
                
                # 如果有角色名字就赋予，没有就不赋予
                if role_name == '':
                    math_node_raname = blendShapeInput_modifier_node_name[BS_CTRL_Name][content_index].replace('.','_') + f"_modifier_ID{str(math_node_id)}"
                else:
                    # 制作新的节点名字
                    math_node_raname = blendShapeInput_modifier_node_name[BS_CTRL_Name][content_index].replace('.','_') + f"_modifier_ID{str(math_node_id)}_{role_name}"
                    
                # 把新命名好的节点名字赋予到 METAHUMAN_MATH_NODE_NAME_LAYER 新的字典列表中
                METAHUMAN_MATH_NODE_NAME_LAYER[METAHUMAN_CONTROLLER_AND_NODENAMES['guiControlNames'][Index]].append(math_node_raname)
                
                # 把新命名好的节点名字赋予到 METAHUMAN_CONTROLLER_AND_NODENAMES 字典中
                METAHUMAN_CONTROLLER_AND_NODENAMES['math_node_name'].append(math_node_raname)
                    
                math_node_id +=1

        
    if role_name == '':
        rl4Embedded_role_raname  = RL4EMBEDDED_ARCHETYPE_INIT_NAME
    else:
        rl4Embedded_role_raname  = RL4EMBEDDED_ARCHETYPE_INIT_NAME + f'_{role_name}'
        
    METAHUMAN_CONTROLLER_AND_NODENAMES['rl4Embedded_name'].append(rl4Embedded_role_raname)

    return METAHUMAN_CONTROLLER_AND_NODENAMES,METAHUMAN_MATH_NODE_NAME_LAYER




