def get_joint_connected_nodes(): # 获取骨骼连接节点
    attribute = ['translateX','translateY','translateZ','rotateX','rotateY','rotateZ','scaleX','scaleY','scaleZ']
    joints_name = []
    joint_connected_dict = {}
    DNA = load_dna(DSM.reading_history_file()['load_dna_path'])
    
    # 获取骨骼名字
    joint_group_count = DNA.getJointCount() # 获取joint的组数
    for i in range(joint_group_count):
        joints_name.append(DNA.getJointName(i))
        
    # 获取骨骼连接节点
    for joint in joints_name:
        joint_connected_dict[joint] = []
        for attr in attribute:
            try:
                connections = cmds.listConnections(joint+'.'+attr, plugs=True)
                if connections:
                    
                    joint_connected_dict[joint].append(connections)
                    joint_connected_dict[joint].append(joint+'.'+attr)

            except:
                pass

def disconnect_joint_connections():
    # 断开骨骼连接节点
    for joint in JOINT_CONNECTED_DICT:
        for i in range(len(JOINT_CONNECTED_DICT[joint])):
            if i % 2 == 0:
                try:
                    cmds.disconnectAttr(JOINT_CONNECTED_DICT[joint][i][0], JOINT_CONNECTED_DICT[joint][i+1])
                except:
                    pass

def connect_joint_nodes():
    # 连接骨骼连接节点
    for joint in JOINT_CONNECTED_DICT:
        for i in range(len(JOINT_CONNECTED_DICT[joint])):
            if i % 2 == 0:
                try:
                    cmds.connectAttr(JOINT_CONNECTED_DICT[joint][i][0], JOINT_CONNECTED_DICT[joint][i+1])
                except:
                    pass     

