    # 获取根关节
    def get_root_joint(self,joint_list):
        """
        从关节列表中获取根关节
        参数:
            joint_list (list): 关节节点的列表
        返回:
            pm.nt.Joint: 根关节，如果没有找到则返回None
        """
        # 使用列表推导式找出所有没有父节点的关节，即根关节
        root_joints = [joint for joint in joint_list if joint.getParent() is None]

        # 如果没有找到根关节，返回None
        if len(root_joints) == 0:
            return None

        # 返回第一个根关节
        return root_joints[0]
    
    # 获取关键帧范围
    def get_key_frame_range(self,node):
        # 使用findKeyframe函数获取第一个和最后一个关键帧
        return float(pm.findKeyframe(node, which='first')), float(pm.findKeyframe(node, which='last'))

    # 获取关键帧范围
    def get_key_frame_ranges(self,nodes):
        """
        获取开始和结束帧的最小和最大值
        """
        # 初始化开始帧和结束帧的列表
        start_frames = []
        end_frames = []

        # 遍历所有节点
        for node in nodes:
            # 获取每个节点的关键帧范围
            start_frame, end_frame = self.get_key_frame_range(node)
            # 将开始帧和结束帧添加到对应的列表中
            start_frames.append(start_frame)
            end_frames.append(end_frame)

        # 返回最小的开始帧和最大的结束帧
        return min(start_frames), max(end_frames)


    def retarget_metahuman_animation_sequence_win(self):
        global METAHUMAN_MATH_NODE_NAME_LAYER
        '''
        将fbx动画导入到场景中，并将曲线数据连接到控制装置。 然后将在控制器上烘焙动画并清理场景。

        为了保持文件大小小而仍然能够带入动画，这里有一些建议的设置 Unreal FBX导出选项： * FBX导出兼容性：2020 * 只设置这些复选框为True * 导出形态目标：True * 导出预览网格：True * 将骨骼动作映射到根：True * 导出本地时间：True

        参数： fbx_path (str): fbx动画的绝对路径 namespace (str): 装置命名空间，这样我们可以收集所有的控制器

        返回： tuple(str, str): 完成所需的时间，错误消息
        '''

        for i in METAHUMAN_MATH_NODE_NAME_LAYER:
            if cmds.objExists(i):
                pass
            else:
                print(f'{i} 不存在，请检查是否有这个控制器')
                return 
        error_msg = ''
        elapsed_time = ''
        
        # 获取fbx路径
        fbx_path = self.load_fbx_path.text()
        
        # 构建控制映射
        controllers= self.get_controllers()
        
        
        new_nodes = self.import_fbx_animation(fbx_path)

        # 24帧/秒
        pm.currentUnit(time='film')

        # 检查是否有动画曲线
        anim_curves = pm.ls(new_nodes, type=pm.nt.AnimCurve)
        
        if not anim_curves:
            print("没有动画曲线！\n\n" "请确保导出的动画来自动画序列！")
            pm.delete(new_nodes)
            
        
        new_joints = pm.ls(new_nodes, type=pm.nt.Joint)
        root_joint = self.get_root_joint(new_joints)
        if not root_joint:
            pm.delete(new_nodes)
            print(f'没有找到根关节：{fbx_path}.\n''请确保导出的动画来自动画序列！')
            pm.delete(new_nodes)
            
            
        # 获取关键帧范围
        start_frame, end_frame = self.get_key_frame_range(root_joint)
        
        # 获取映射数据并将动画关键帧复制到正确的控制通道
        blend_weighted_nodes = []
        controls_attrs_to_bake = []
        for controller in controllers:
            for control_attr, expression_data in controller.control_mapping.items():

                # 连接有多个动画曲线驱动的控制通道
                if len(expression_data) > 1:
                    anim_curves = []
                    for index, (expression, driver_value) in enumerate(expression_data):				
                        if root_joint.hasAttr(expression):
                            anim_curve = root_joint.attr(expression).inputs(type=pm.nt.AnimCurve)
                            if anim_curve:
                                # 控制在负方向移动
                                if driver_value == -1.0:
                                    # 获取动画曲线并将其缩放为-1 
                                    pm.scaleKey(anim_curve[0], valueScale=-1.0)
                            else:
                                logger.error('没有动画曲线 {}'.format(root_joint.attr(expression)))
                            
                            anim_curves.append(anim_curve[0])
                        else:
                            logger.warning('{} 的名称中没有 {}，将跳过此项！'.format(root_joint, expression))
                    
                    # 连接动画曲线
                    bw_node = pm.createNode('blendWeighted')
                    for i, anim_curve in enumerate(anim_curves):
                        anim_curve.output.connect(bw_node.input[i])
                    bw_node.output.connect(control_attr)
                    controls_attrs_to_bake.append(control_attr)
                else:
                    for index, (expression, driver_value) in enumerate(expression_data):
                        if root_joint.hasAttr(expression):
                            anim_curve = root_joint.attr(expression).inputs(type=pm.nt.AnimCurve)
                            if anim_curve:
                                copied = pm.copyKey(root_joint.attr(expression))
                                if copied:
                                    try:
                                        pm.pasteKey(control_attr)
                                    except RuntimeError:
                                        logger.error('无法粘贴关键帧到 {}'.format(control_attr))
                        else:
                            logger.warning('{} 的名称中没有 {}，将跳过此项！'.format(root_joint, expression))
        
        # 烘焙控制
        pm.bakeResults(controls_attrs_to_bake, 
                        time=[int(start_frame), int(end_frame)], 
                        preserveOutsideKeys=True, 
                        sparseAnimCurveBake=False,
                        sampleBy=1, 
                        oversamplingRate=1,
                        removeBakedAttributeFromLayer=False, 
                        removeBakedAnimFromLayer=False,
                        shape=False, 
                        controlPoints=False, 
                        disableImplicitControl=True)
                    
        # 清理
        pm.delete(blend_weighted_nodes) 	
        pm.delete(new_nodes)

        pm.playbackOptions(animationStartTime=int(start_frame), animationEndTime=int(end_frame))





    def import_fbx_animation(self,fbx_path):
        """
        导入FBX动画数据
        参数:
            fbx_path (str): FBX动画的绝对路径
        返回:
            list: 导入的节点列表
        """
        # 设置导入选项
        pm.mel.FBXImportShapes(v=False)  # 不导入形状
        pm.mel.FBXImportSkins(v=False)  # 不导入皮肤
        pm.mel.FBXImportMode(v='add')  # 添加模式
        pm.mel.FBXImportMergeAnimationLayers(v=False)  # 不合并动画层
        pm.mel.FBXImportProtectDrivenKeys(v=True)  # 保护驱动键
        pm.mel.FBXImportSetMayaFrameRate(v=False)  # 不设置Maya帧率

        # 获取当前的节点列表
        cur_nodes = set(pm.ls())

        # 导入FBX文件
        pm.mel.FBXImport(file=fbx_path, take=1)

        # 返回新导入的节点列表
        return list(set(pm.ls()) - cur_nodes)

    class Controller():
        def __init__(self, control, ctrl_expressions_node):
            '''
            用于保存和训练面部表情以控制通道属性的类
            Args:
                control (pm.nt.Transform): 控制节点
                ctrl_expressions_node (pm.nt.Transform): 保存面部表情的变换节点
            '''
            # 检查输入的参数是否为正确的类型
            if not isinstance(control, pm.nt.Transform):
                print('{} 不是一个控制变换节点'.format(control))
                return
            if not isinstance(ctrl_expressions_node, pm.nt.Transform):
                print('{} 不是 CTRL_expressions 节点!'.format(ctrl_expressions_node))
                return
            # 检查 ctrl_expressions_node 是否为 'CTRL_expressions'
            if ctrl_expressions_node.stripNamespace() != 'CTRL_expressions':
                print('{} 不是 CTRL_expressions 节点!'.format(ctrl_expressions_node))
                return
            # 获取 ctrl_expressions_node 中的用户定义的标量属性
            expression_list = ctrl_expressions_node.listAttr(userDefined=True, scalar=True)
            expression_list = [exp.attrName() for exp in expression_list]

            # 如果没有找到任何表达式，抛出错误
            if not expression_list:
                print('在 {} 中找不到表达式! 无法处理!'.format(ctrl_expressions_node))
                return
            # 初始化类的实例变量
            self.control = control
            self._ctrl_expressions_node = ctrl_expressions_node
            self._expression_list = expression_list
            self._control_mapping = {}
            self.train_control_expressions()

        def train_control_expressions(self):
            ''' 
            通过确定控制限制和可键控的内容来训练控制表达式
            并在控制属性和驱动表达式之间创建映射
            '''
            control_limits = {}
            self._control_mapping = {}
            mapping = {}
            free_to_change = pm.Attribute.FreeToChangeState.freeToChange

            # 检查 'tx' 和 'ty' 属性是否可自由改变并且可键控
            if self.control.attr('tx').isFreeToChange() == free_to_change and self.control.attr('tx').isKeyable():
                control_limits[self.control.attr('tx')] = [pm.transformLimits(self.control, translationX=True, query=True),
                                                        'tx']
            if self.control.attr('ty').isFreeToChange() == free_to_change and self.control.attr('ty').isKeyable():
                control_limits[self.control.attr('ty')] = [pm.transformLimits(self.control, translationY=True, query=True),
                                                        'ty']
            if control_limits:
                for control_attr, (ctrl_limits, channel_name) in control_limits.items():
                    for value in ctrl_limits:
                        # 设置控制值，这将驱动表达式
                        control_attr.set(value)

                        # 循环遍历表达式以确定哪个是活动的
                        for exp in self._expression_list:
                            cur_value = self._ctrl_expressions_node.attr(exp).get()
                            if cur_value > 0 or cur_value < 0:
                                # 表达式名称与来自 FBX 文件的关键帧属性名称匹配
                                # 这将使得将关键帧数据连接到控制更加容易
                                driven_anim_name = 'CTRL_expressions_{}'.format(exp)
                                mapping[driven_anim_name] = [self.control.attr(channel_name), value]
                    # 重置控制
                    control_attr.set(0.0)

            # 创建控制映射
            for key, (attr, value) in mapping.items():
                if attr not in self._control_mapping:
                    self._control_mapping[attr] = []
                self._control_mapping[attr].append([key, value])

        @property
        def control_mapping(self):
            # 返回 _control_mapping 的值
            return self._control_mapping

        def is_valid(self):
            # 检查 control_mapping 是否存在
            if self.control_mapping:
                return True
            else:
                return False

    def get_controllers(self):
        
        global EXCLUDED_RETARGET_CONTROLS
        # 初始化错误消息
        error_msg = ''
        face_controls = self.get_face_controls()
        
        # 检查是否有控制器存在
        if face_controls == []:
            print( '没有控制器存在！\n\n' \
                        '请确保导出的动画来自动画序列！')

        
        if self.role_name.text() == '':
            expression_node = 'CTRL_expressions'
        else:
            expression_node = '{}{}'.format(self.role_name.text()+':','CTRL_expressions')
        
        # 控制器归零
        self.zero_out_face_controls_win()
        
        controllers = []
        
        for face_control in face_controls:
            if face_control not in EXCLUDED_RETARGET_CONTROLS:
                controller = self.Controller(face_control, pm.PyNode(expression_node))
                if controller.is_valid():
                    controllers.append(controller)

        return controllers

