    # 创建节点
    def configure_nodes_win(self):
        
        # 声明全局变量
        global blendShapeInput_modifier_node_name,METAHUMAN_CONTROLLER_AND_NODENAMES
        
        # 初始化变量

        math_node_name_index = 0 

        role_name = self.role_name.text()
        
        # 判断角色名字是否为空，如果为空就不赋予角色名字，如果有就赋予角色名字
        if role_name == '':
            role_name = ''
        else:
            role_name = role_name + ':'
        
        
        
        
        # 遍历blendShapeInput_modifier_node_name字典
        for index, bs_node_key in enumerate(blendShapeInput_modifier_node_name):

            # 遍历字典中的值，步长为2
            for i in range(0, len(blendShapeInput_modifier_node_name[bs_node_key]), 2):
                try:
                    # 创建节点名字并创建节点改模式
                    node_name = METAHUMAN_CONTROLLER_AND_NODENAMES['math_node_name'][math_node_name_index]
                    
                    # 判断节点是否存在 
                    if cmds.objExists(node_name):

                        # 把节点连接到计算节点上
                        cmds.connectAttr(role_name + blendShapeInput_modifier_node_name[bs_node_key][i], node_name +'.floatA', f=True)

                        # 把计算节点连接到输出上
                        cmds.connectAttr(node_name+'.outFloat', blendShapeInput_modifier_node_name[bs_node_key][i+1], f=True)
                        
                        print("检查到已经存在节点，已经连接到计算节点上")
                        
                    else:  

                        math_node = cmds.shadingNode('floatMath', asUtility=True, name=node_name)
                        
                        cmds.setAttr(node_name+'.operation', 2)

                        # 把节点连接到计算节点上
                        cmds.connectAttr(role_name + blendShapeInput_modifier_node_name[bs_node_key][i], math_node +'.floatA', f=True)

                        # 把计算节点连接到输出上
                        cmds.connectAttr(math_node+'.outFloat', blendShapeInput_modifier_node_name[bs_node_key][i+1], f=True)
                        
                except:
                    print('这两个节点无法连接，请你检查规范' )
                
                # 更新索引
                math_node_name_index += 1
    
