    def modify_math_nodes_win(self, _):
        
        value = self.math_node_slider.value() / 1000.0000
        sl_node = self.guiControlNamesListLine.selectedItems()
        for i in sl_node:
            cmds.setAttr(i.text()+'.floatB',  value)
    
    # 复原
    def restore_win(self):
        global METAHUMAN_MATH_NODE_NAME_LAYER
        if keyboard.is_pressed('shift'):
            for key in METAHUMAN_MATH_NODE_NAME_LAYER:
                for math_node_name in METAHUMAN_MATH_NODE_NAME_LAYER[key]:
                    cmds.setAttr(math_node_name+'.floatB', 1 )
        else:

            sl_node = self.guiControlNamesListLine.selectedItems()
            for i in sl_node:
                cmds.setAttr(i.text()+'.floatB',  1)

    def save_role(self, _):
        role_name = self.role_name.text()
        DSM.modify_file_attr('role_name',role_name)

    # 选择对象把数值还原到滑杆上，多选算权重平均值
    def self_weighted_average_win(self):
        sl_node = self.guiControlNamesListLine.selectedItems()
        
        node_val = []
     
        for node_name in sl_node:
            ndoe = (node_name.text())
            node_val.append(cmds.getAttr(f'{ndoe}.floatB'))
            
        weighted_average_val = self.weighted_average(node_val)
        
        self.math_node_slider.setValue(weighted_average_val * 1000)

        
    # 算权重平均值
    def weighted_average(self,values):
        weights = values
        return sum(v*w for v, w in zip(values, weights)) / sum(weights)
    
    # 修复节点
    def repair_node_win(self):
        global METAHUMAN_CONTROLLER_AND_NODENAMES
        for i in METAHUMAN_CONTROLLER_AND_NODENAMES['math_node_name']:
            cmds.setAttr(i+'.operation', 2)

