# 计算较低lod网格
def CalculateMeshLowerLODs(path,save_path):
    dna = load_dna(path)
    
    meshindex = dna.getMeshIndexListCount()

    calibrated = dnacalib.DNACalibDNAReader(dna)
    
    start_time = time()
    for i in range(meshindex+1):
        
        CalculateMeshLowerLODs = dnacalib.CalculateMeshLowerLODsCommand(i)

        commands = dnacalib.CommandSequence()
        
        commands.add(CalculateMeshLowerLODs)

        commands.run(calibrated)
    end_time = time()

    usage_time('计算较低 LOD 网格', start_time, end_time)
    
    save_dna(calibrated,save_path)

# 快速修改名字
def quicke_rename_mesh():
    selected_objects = cmds.ls(selection=True)
    eye_num_vertices = 0
    
    def rename_objects(name_suffix):
        
        # 使用 nonlocal 关键字来在内部函数中修改外部变量
        nonlocal eye_num_vertices
        
        for obj in selected_objects:
            # 获取对象的顶点数量
            num_vertices = cmds.polyEvaluate(obj, vertex=True)

            # 遍历字典，查找匹配的顶点数量
            for key in METAHUMAN_NON_EYE_MESH_DATA:
                if METAHUMAN_NON_EYE_MESH_DATA[key][0] == num_vertices:
                    # 如果找到匹配的顶点数量，重新命名对象
                    cmds.rename(obj, key + name_suffix)

            for key in METAHUMAN_EYE_MESH_DATA:
                if int(key) == num_vertices:
                    # 如果找到匹配的顶点数量，重新命名对象
                    cmds.rename(obj, METAHUMAN_EYE_MESH_DATA[key][eye_num_vertices] + name_suffix)
                    eye_num_vertices += 1
            # cmds.rename(obj , METAHUMAN_EYE_MESH_DATA['770'][eye_num_vertices] + name_suffix)
            # eye_num_vertices += 1
                    
    if keyboard.is_pressed('shift'):
        rename_objects('_new')
    elif keyboard.is_pressed('alt'):
        rename_objects('_Temp')
    else:
        rename_objects('')
        
        

        
