def load_dna(path):
    start_time = time()
    
    path = path.replace("\\", "/")
    #...以二进制打开dna
    stream = dna.FileStream(path, dna.FileStream.AccessMode_Read, dna.FileStream.OpenMode_Binary)

    #...创建dna容器
    reader = dna.BinaryStreamReader(stream, dna.DataLayer_All)
    
    #...调用read读取数据
    reader.read()
    
    if not dna.Status.isOk():
        status = dna.Status.get()
        raise RuntimeError(f"读取错误DNA数据: {status.message}")
    end_time = time()
    
    usage_time('load_dna',start_time,end_time)
    return reader

def save_dna(reader,path):
    
    if path == '':
        print('请你输入保存路径')
        return
    
    # Saves the dna
    start_time = time()
    stream = dna.FileStream( path, dna.FileStream.AccessMode_Write, dna.FileStream.OpenMode_Binary)
    writer = dna.BinaryStreamWriter(stream)
    writer.setFrom(reader)
    writer.write()
    
    end_time = time()
    print('-----'*10)
    print("保存DNA所需时间：%a" % str(end_time-start_time))

    
    print('-----'*10)



def binary_to_json(path,save_path):

    reader = load_dna(path)
    
    stream = dna.FileStream(save_path,dna.FileStream.AccessMode_Write, dna.FileStream.OpenMode_Binary)
    writer = dna.JSONStreamWriter(stream)
    
    writer.setFrom(reader)

    writer.write()

