def usage_time(command_name,start_time,end_time):
    print('-----'*10)
    print(command_name+" 操作所需时间：%a" % str(end_time-start_time))
    print('-----'*10)

def emove_pattern_from_dict_values(connections,patterns):
    start_time = time()
    
    # 创建一个新的字典来存储结果
    new_connections = {}

    # 对字典中的每个键值对进行操作
    for key, values in connections.items():
        # 使用列表推导式来删除特定元素
        new_values = [value for value in values if not any(re.search(pattern, value) for pattern in patterns)]
        
        # 将结果存储在新的字典中
        new_connections[key] = new_values
    end_time = time()
    usage_time('emove_pattern_from_dict_values',start_time,end_time)
    
    for node, connected_nodes in new_connections.items():
        print(f'{node}: {connected_nodes}')
    return new_connections

def get_connected_nodes(nodes):
    start_time = time()
    # 创建一个空字典来存储结果
    connections = {}

    # 对列表中的每个节点进行操作
    for node in nodes:
        # 获取节点连接过的所有节点
        connected_nodes = cmds.listConnections(node, connections=True,plugs=True)
        
        # 将结果存储在字典中
        connections[node] = connected_nodes



    end_time = time()
    usage_time('get_connected_nodes',start_time,end_time)

    # 打印结果
    for node, connected_nodes in connections.items():
        print(f'{node}: {connected_nodes}')
        
    return

